import { playOpenSound } from '../util/sounds'
import { setWriteMode } from '../logic/appMode'

export const WriteButton = () => (
  <div>
    <button
      onClick={() => {
        playOpenSound()
        setWriteMode()
      }}
    >
      Write
    </button>
  </div>
)
